  04> NELSON, Guy William
  b 21.12.1972
  Address: 21 Marchwiel Road, Timaru.
  Guy was educated at Hereworth School, King's College and Christ's College. He worked as a shepherd
  in Hawkes Bay then in 1995 he began a BAgComm degree at Lincoln University and graduated with a
  double major in Valuation and Farm Management in 1995. In 1996 he worked for the National Bank in
  Invercargill as Rural Manager and he is now in Timaru working for Ag New Zealand as a farm advisor.
  05> NELSON, Samuel William
  b 05.06.1975
  Samuel was educated at Hereworth School, Hastings Boys' High School and King's College and is now
  in completing a Law degree at Canterbury University.
  06> NELSON, Sarah St John
  b 01.08.1977
  Sarah was educated at Havelock North Primary and Intermediate and Woodford House then took a year
  out of school and worked in England for part of 1996. She is now studying Arts at Canterbury
  University.
  03> NELSON, James Palmer m on 11.05.1968 to ORR, Helen Anne
  b 09.09.1941
  b 22.06.1943
  James b. at Hastings and m. at St Luke's Church, Havelock North. Helen, d/o Charles Ronald Orr and Joan
  Sarah Mackay, b. at Waipawa. Address: PO Box 2440, Stortford Lodge, Hastings.
  James has farmed at "Kaikoura" station, Gisborne, since 1965 and is presently an apple orchardist in
  Raupare Road, Hastings.
